package com.MaoTu.Bean;

public class Message {
	private int concenID;
	private String concenName;
	private String conPublish;
	private String conVisit;
	private String confans;
	private String conmessage;
	private String conImg;
	public Message() {
		// TODO Auto-generated constructor stub
	}
	public int getConcenID() {
		return concenID;
	}
	public void setConcenID(int concenID) {
		this.concenID = concenID;
	}
	public String getConcenName() {
		return concenName;
	}
	public void setConcenName(String concenName) {
		this.concenName = concenName;
	}
	public String getConPublish() {
		return conPublish;
	}
	public void setConPublish(String conPublish) {
		this.conPublish = conPublish;
	}
	public String getConVisit() {
		return conVisit;
	}
	public void setConVisit(String conVisit) {
		this.conVisit = conVisit;
	}
	public String getConfans() {
		return confans;
	}
	public void setConfans(String confans) {
		this.confans = confans;
	}
	public String getConmessage() {
		return conmessage;
	}
	public void setConmessage(String conmessage) {
		this.conmessage = conmessage;
	}
	public String getConImg() {
		return conImg;
	}
	public void setConImg(String conImg) {
		this.conImg = conImg;
	}

}
